import React, {useState, useEffect} from 'react';
import {ActivityIndicator, Dimensions, StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';
import { restaurants } from '../App';

export default  function Home({navigation}) {
    return (
        <View style={{flex: 1}}>
          <ScrollView style={styles.container}>{
            restaurants.map((restaurante) => {
              return(
                  <TouchableWithoutFeedback  key={restaurante.id}  onPress={() => navigation.push('restaurants', {user : restaurante})}>
                    <View style={{flex : 1, flexDirection : 'column', justifyContent : 'flex-start', alignItems:'center'}}>
                      <Text style={styles.username}>{restaurante}</Text>
                      <Text style={styles.bio}>"{restaurante.price} * {restaurante.tags}"</Text>
                    </View>
                  </TouchableWithoutFeedback>
              )
            })
          }</ScrollView>
        </View>
    );
}


const styles = StyleSheet.create({
    container: {
      backgroundColor: 'black',
    },
    username: {
      fontSize: 20,
      textAlign: 'center',
    },
    bio : {
      justifyContent:'flex-start',
    },
  });
